  return (
    <main>
      <div className="main">
        {/* <ReactPlayer url={clip.video} controls /> */}
      </div>
      <div className="main__videoDetails">
        <p>{clip.title}</p>
        <p>{clip.duration}</p>
        <textarea
          className="main__notebox"
          input="text"
          placeholder="Notes..."
        />
      </div>
      <div></div>
    </main>
  );
}

